import React from 'react';
import "./css/Startseite.css";

class Home extends React.Component {
	render() {
		return (
			<>

				<button onClick={event =>  window.location.href='/Room'} className="host_room">Einen vorhanden Raum beitreten</button>

				<button onClick={event =>  window.location.href='/Room'} className="join_room">Einen vorhanden Raum beitreten</button>


			</>
		);
	};
}
export default Home;
